import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import Link from '@mui/material/Link';


import CarterProfile from "../../imgExample/carterProfile.jpg";


export default function UserBio() {
  return (
    <Card sx={{ maxWidth: 200, borderRadius: 0, display: { sm: 'none', md: 'block' } }} elevation={0}>
      <CardMedia
        component="img"
        alt="green iguana"
        height="200"
        image={CarterProfile}
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Cater
        </Typography>
        <Typography variant="body2" color="text.secondary" sx={{display: 'inline'}}>
        대학교에서 예술공학을 전공하고 있으며 말그대로 예술과 공학 둘 다 배우고 있습니다. C, 파이썬, 에프터이펙트, 마야를 배우고 있지만 ...&nbsp; 
        </Typography>
        <Link href="#" color="inherit" sx={{display: 'inline', fontSize: 14}}>
            더보기
        </Link>
      </CardContent>
      <CardActions>
        <Button size="small" sx={{textTransform: 'none', fontSize: 15}}>Blog</Button>
        <Button size="small" sx={{textTransform: 'none', fontSize: 15}}>Instagram</Button>
      </CardActions>
    </Card>
  );
}
